import React from "react";
import { Typography, Space, Row, Col, Button } from "antd";
import { useRouter } from "next/router";
const { Text } = Typography;

const Home = () => {
	const router = useRouter();

	const toDog = () => {
		router.push("/dog");
	};

	const toCat = () => {
		router.push("/cat");
	};

	return (
		<>
			<Row justify="center">
				<Text
					style={{
						textAlign: "center",
						display: "block",
						marginTop: "50px",
						fontSize: "20px",
					}}
				>
					나랑 어울리는 애완동물은?
				</Text>
			</Row>

			<Row justify="center">
				<img
					style={{
						display: "block",
						marginLeft: "auto",
						marginRight: "auto",
						width: "100%",
						height: "auto",
					}}
					src={require("../assets/dog.png")}
				/>
			</Row>

			<Row justify="center">
				<Col xs={18} sm={18} md={18} lg={18} xl={18}>
					<Button
						style={{
							display: "block",
							marginTop: "40px",
							width: "100%",
						}}
						onClick={toDog}
					>
						테스트 시작!
					</Button>
				</Col>
			</Row>
		</>
	);
};

export default Home;
